import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import { BrowserRouter } from 'react-router-dom';
import Slider from './components/Slider';

ReactDOM.render(
  <React.StrictMode>

    <BrowserRouter>
      <App />
      <Slider/>
    </BrowserRouter>
  </React.StrictMode>,
  document.getElementById('root')
);
